//import { Link } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css'
//import { Container } from 'react-bootstrap'
import SideNav from '../components/sidenav';


function DashPage() {
    const navStatus = {
        active1: true,
        active2: false,
    };
    return(
    <div>
        <div>
        <SideNav actives={navStatus}/>
        </div>
        <div>
            <h1>hello</h1>
        </div>
    </div>
    );
}

export default DashPage;
